def react_iter(polymer):
    p = 0
    while p < len(polymer):
        if p < len(polymer)-1 and polymer[p].lower() == polymer[p+1].lower() and polymer[p] != polymer[p+1]:
            p += 1
        else:
            yield polymer[p]
        p += 1

def react(polymer):
    return ''.join(list(react_iter(polymer)))

def fully_react(polymer):
    while react(polymer) != polymer:
        polymer = react(polymer)
    return polymer

polymer = ''

